function easychat_set_cookie(cookiename,cookievalue,expiration,path="") {
    if (path==""){
        document.cookie = cookiename + "=" + cookievalue+"; expires="+expiration;
    }
    else{
        document.cookie = cookiename + "=" + cookievalue+"; path="+path+"; expires="+expiration;
    }
}

